import "./App.css";
import "./components/Header";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button } from "react-bootstrap";
import { Nav } from "react-bootstrap";
import Header from "./components/Header";

function App() {
  return (
    <div>
      <Header />
      {/* <img src={logo} className="App-logo" alt="logo" />  */}
      <div className="container-lg ">
        <h4>HomeLab</h4>

        <div className="row">
          <div className="col-4">
            Vous voulez effectuer une analyse qui vous a été prescrite Plus
            besoin de vous déplacer, au lieu de se déplacer vers les
            laboratoires d’analyse, ce sont les laboratoires qui se déplacent
            vers vous. Grâce à la plateforme HomeLab faites vous analyser ou que
            vous soyez
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
